  "text" : "\uC5EC\uD2BC.. \uC800\uB3C4 \uC9C0\uAE08\uAE4C\uC9C0\uB294 \uADF8\uB0E5 \uD3B8\uC758\uC0C1 DS \uC0AC\uAC74\uC744 \uB9D0\uD560 \uB54C '\uC131\uD76C\uB871'\uC774\uB77C\uACE0 \uD45C\uD604\uD588\uC2B5\uB2C8\uB2E4\uB9CC, \uC55E\uC73C\uB85C\uB294 \uC131\uD76C\uB871\uC774 \uC544\uB2CC '\uD1B5\uC2E0\uB9E4\uCCB4\uB97C \uC774\uC6A9\uD55C \uC74C\uB780\uD589\uC704' \uD639\uC740 '\uC74C\uB780\uD589\uC704'\uB77C\uACE0 \uBA85\uD655\uD558\uAC8C \uC9C0\uCE6D\uD558\uACA0\uC2B5\uB2C8\uB2E4. \uC790\uAFB8 \uC131\uD76C\uB871\uC774\uB77C\uACE0 \uD558\uC2DC\uB2C8\uAE4C \uBD88\uD544\uC694\uD55C \uB17C\uC7C1\uC774 \uCD94\uAC00\uB418\uB294 \uB4EF..",
