  "text" : "\uB300\uBC95\uC6D0\uC740 2007\uB45022498 \uD310\uB840\uC5D0\uC11C \uC131\uD76C\uB871\uC5D0\uC11C\uC758 \uC131\uC801 \uC5B8\uB3D9\uC758 \uC758\uBBF8\uC640 \uADF8 \uD310\uB2E8 \uAE30\uC900\uC5D0 \uB300\uD574 \uB2E4\uC74C\uACFC \uAC19\uC774 \uC815\uC758\uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4. \n\n[\u2018\uC131\uC801\uC778 \uC5B8\uB3D9 \uB4F1\u2019\uC774\uB780 \uB0A8\uB140 \uAC04\uC758 \uC721\uCCB4\uC801 \uAD00\uACC4\uB098 \uB0A8\uC131 \uB610\uB294 \uC5EC\uC131\uC758 \uC2E0\uCCB4\uC801 \uD2B9\uC9D5\uACFC \uAD00\uB828\uB41C \uC721\uCCB4\uC801, \uC5B8\uC5B4\uC801, \uC2DC\uAC01\uC801 \uD589\uC704\uB85C\uC11C",
