  "text" : "\uB05D\uC7A5\uB09C \uB9C9\uC7A5 \uC5F0\uC560\uB2F4\uC740 \uBCF4\uD1B5 50% \uC815\uB3C4\uB9CC \uBBFF\uACE0 \uD310\uB2E8\uD558\uBA74 \uC5BC\uCD94 \uB4E4\uC5B4\uB9DE\uB354\uB77C. \uC774\uC57C\uAE30\uCC98\uB7FC \uC9C4\uC9DC \uB098\uC05C \uC0C1\uB300\uB97C \uB9CC\uB0AC\uB358 \uAC83\uC774\uB358\uAC00, \uC544\uB2C8\uBA74 \uD3B8\uC9D1\uB418\uACE0 \uBBF8\uD654\uB41C \uD654\uC790 \uBCF8\uC778\uC758 \uC6D0\uC778 \uC81C\uACF5\uC73C\uB85C \uC778\uD574 \uC0C1\uB300\uAC00 \uB098\uC058\uAC8C \uBCC0\uD55C \uAC83\uC774\uC5C8\uB358\uAC00.. \uCC28\uB77C\uB9AC \uBB34\uB364\uB364\uD55C \uD6C4\uAE30\uAC00 \uB354 \uC2E0\uB8B0\uAC00 \uAC00\uB354\uB77C.",
