  "text" : "\uB9CC\uC77C \uC774 \uC5ED\uB9B0\uC744 \uAC74\uB4DC\uB9AC\uB294 \uC790\uAC00 \uC788\uB2E4\uBA74, \uC6A9\uC740 \uBBF8\uCCD0 \uB0A0\uB6F0\uAC8C \uB41C\uB2E4. \uADF8 \uC0AC\uB78C\uC774 \uB204\uAD6C\uB4E0 \uC8FD\uC5EC \uBC84\uB9B0\uB2E4. \uAD70\uC8FC \uC5ED\uC2DC \uC6A9\uACFC \uAC19\uB2E4. \uADF8\uB7EC\uB098 \uAD70\uC8FC\uC5D0\uAC8C\uB3C4 \uC5ED\uB9B0\uC774 \uC788\uB294 \uAC83\uC774\uB2C8, \uC774 \uAC83\uC744 \uAC74\uB4DC\uB9AC\uB294 \uAC83\uC740 \uBB34\uBAA8\uD55C \uC9D3\uC774\uB2E4. - \uD55C\uBE44\uC790(\u97D3\u975E\u5B50) @seungow",
