  "text" : "\uB178\uCD9C\uD558\uBA74 \uC7A1\uD600\uAC04\uB2E8 \uB8E8\uBA38 \uD37C\uB728\uB9AC\uB294 \uB188\uB4E4, \uB108\uC774 \uAC1C\uC0C8\uAE84! \uB108! \uBA38\uB9AC\uD138\uB05D\uBD80\uD130 \uBC1C\uD1B1\uAE4C\uC9C0 \uC774 \uC9C0\uAD6C\uC0C1 \uB3D9\uC11C\uB0A8\uBD81 \uC5B4\uB514\uC11C\uB3C4 \uB2C8 \uC2DC\uCCB4\uB97C \uCC3E\uC744 \uC218 \uC5C6\uC744\uAEBC\uC57C. \uC65C? \uB0B4\uAC00 \uC798\uADFC\uC798\uADFC \uC539\uC5B4\uBA39\uC744 \uD14C\uB2C8\uAE4C.. \uD06C\uD761 \u3160 \uB0B4\uAC00 \uC798\uBABB\uD588\uB2E4. \uB0B4 \uC774\uB9D0 \uCDE8\uC18C\uD55C\uB2E4, \uCDE8\uC18C\uD574.. \uC73C\uB974\uC2E0! \uD68C\uC7DD\uB2D8!",
