  "text" : "\uC740\uADFC\uD788 \uB9CE\uC740 \uBD84\uB4E4\uC774 \uC0DD\uAC01\uD558\uACE0 \uACC4\uC2E0 \uAC83\uCC98\uB7FC \uACBD\uBC94\uC8C4\uCC98\uBC8C\uBC95\uC758 \uACFC\uB2E4\uB178\uCD9C \uCC98\uBC8C\uC870\uD56D\uC774 \uAC11\uC790\uAE30 \uD558\uB298\uC5D0\uC11C \uB69D \uB5A8\uC5B4\uC9C4\uAC74 \uC544\uB2C8\uC5D0\uC694. \uC0DD\uAC01\uBCF4\uB2E4 \uC0AC\uB840\uAC00 \uB9CE\uC774 \uCD95\uC801\uB418\uC5C8\uACE0, \uC774\uC5D0 \uB300\uD55C \uC9C0\uCE68\uB3C4 \uAF64 \uBA85\uD655\uD788 \uC11C\uC788\uC2B5\uB2C8\uB2E4. \uC8FC\uBCC0\uC5D0 \uD56B\uD32C\uCE20 \uC785\uC5C8\uB2E4\uAC00 \uC7A1\uD600\uAC04 \uC0AC\uB78C \uC788\uB358\uAC00\uC694? @seungow",
