  "text" : "\uADF8\uB7F0 \uBB38\uC81C\uAC00 \uBB34\uC2A8 \uB2E4\uB9C8\uACE0\uCE58\uB3C4 \uC544\uB2C8\uACE0, \uC65C \uADF8\uB807\uAC8C\uB4E4 \uD0A4\uC6B0\uC2DC\uB294\uAC70\uC5D0\uC694? \uBC95\uB960\uC801 \uBB38\uC81C\uB294 \uB9C8\uCE58 \uC554\uC138\uD3EC\uC640 \uAC19\uC544\uC11C, \uBC29\uCE58\uD588\uB2E4\uAC00\uB294 \uB098\uC911\uC5D0 \uD6C4\uD68C\uD569\uB2C8\uB2E4. \uC554\uC138\uD3EC\uAC00 \uC628\uBAB8\uC5D0 \uB2E4 \uC804\uC774\uB418\uC5B4 \uC190\uC744 \uC4F8 \uC218 \uC5C6\uB294 \uC0C1\uD0DC\uC5D0\uC11C, \uADF8\uC81C\uC57C \uC758\uC0AC\uC5D0\uAC8C \uCC3E\uC544\uAC00 \uC0B4\uB824\uB2EC\uB77C\uACE0 \uBE4C\uBA74 \uADF8\uAC8C \uBB34\uC2A8 \uC18C\uC6A9\uC774\uB78C",
