  "text" : "\uAD70\uBCF5\uBB34\uB97C \uD558\uBA74\uC11C \uBAA8\uCC98\uC640 \uBAA8\uCC98\uC5D0 \uC788\uB294 \uD55C\uAD6D\uAD70\uACFC \uC8FC\uD55C\uBBF8\uAD70\uC758 \uBC99\uCEE4\uC5D0 \uB4E4\uC5B4\uAC00\uBCF8 \uACB0\uACFC, '\uC6B0\uB9AC\uB098\uB77C\uB294 \uBBF8\uAD6D \uC5C6\uC774\uB294 \uADF8\uB0E5 X\uB3FC\uB294\uAD6C\uB098..' \uB77C\uB294 \uACB0\uB860\uC5D0 \uB2E4\uB2E4\uB974\uAC8C \uB418\uC5C8\uC74C. \uC7E4\uB4E4 \uC5C6\uC774\uB294 \uC6B0\uB9AC\uAC00 \uD560 \uC218 \uC788\uB294 \uAC83\uC774 \uC544\uBB34\uAC83\uB3C4 \uC5C6\uC5B4 \uC9C4\uC9DC.. \uC790\uC874\uC2EC \uC0C1\uD588\uC9C0\uB9CC, \uC740\uADFC\uD788 \uB4E0\uB4E0\uD588\uB2E4.",
