  "text" : "\uB0B4 \uAD70\uC0DD\uD65C\uB3C4 \uADF8\uB7AC\uACE0.. \uBBF8\uCFE1\uC774\uB780 \uC874\uC7AC\uB294 \uBE68\uB300 \uAF3D\uACE0 \uC788\uB294 \uD798\uAECF \uCABD\uCABD \uBE68\uC544\uBA39\uC5B4\uC57C \uD558\uB294 \uADF8\uB7F0 \uC874\uC7AC\uC600\uC74C. \uC5B4\uB290 \uC815\uB3C4 \uADDC\uBAA8\uAC00 \uC788\uB294 \uB2E8\uC704\uC5D0\uC11C \uAD70\uBCF5\uBB34\uB97C \uD574 \uBCF8 \uC0AC\uB78C\uC774\uB77C\uBA74 \uC798 \uC54C\uAC83\uC784. \uC6B0\uB9AC \uB300\uD55C\uBBFC\uAD6D\uC740 \uBBF8\uAD6D\uC774\uB77C\uB294 \uB4B7\uBC30\uACBD \uC5C6\uC774\uB294 \uD560 \uC218 \uC788\uB294\uAC8C \uAC70\uC758 \uC5C6\uB294 \uB098\uB77C\uB77C\uB294 \uAC83\uC744.",
