  "text" : "\uC77C\uAC01\uC5D0\uC11C \uC81C\uAE30\uB418\uB294 \uAE40\uC885\uD6C8\uACFC \u7F8E CIA\uC640\uC758 \uC5F0\uAD00\uC124 \uB4F1\uB3C4 \uB0B4\uAC8C\uB294 \uBCC4\uB85C \uB098\uC058\uC9C0 \uC54A\uC558\uC74C. \uB0B4\uAC8C \uC788\uC5B4 \uBBF8\uAD6D\uC774\uB780 '\uBE68\uC544\uBA39\uC744 \uC218 \uC788\uB2E4\uBA74 \uAC00\uB2A5\uD55C \uB9CE\uC774 \uBE68\uC544 \uBA39\uC5B4\uC57C \uD558\uB294' \uADF8\uB7F0 \uC874\uC7AC\uC778\uC9C0\uB77C, \uADF8\uC815\uB3C4 \uCEE4\uB125\uC158\uC774 \uC788\uB294 \uC0AC\uB78C\uC774 \uD55C\uAD6D\uC815\uBD80\uB85C \uB4E4\uC5B4\uC624\uB294 \uAC83\uB3C4 \uAF64\uB098 \uB9E4\uB825\uC801\uC73C\uB85C \uBCF4\uC600\uC74C.",
