  "text" : "\uC6B0\uB9AC\uB098\uB77C \uAD6D\uBBFC\uB4E4\uC740 \uBBFC\uC871\uC758 \uC6B0\uC218\uC131 \uC774\uC57C\uAE30\uB9CC \uB098\uC624\uBA74 \uAF2D '\uC138\uACC4\uC5D0\uC11C \uD55C\uBBFC\uC871\uACFC \uC720\uB300\uBBFC\uC871\uC774 \uAC00\uC7A5 \uBA38\uB9AC\uAC00 \uC88B\uB2E4\uB354\uB77C'\uB77C\uBA70 \uC6B0\uB9AC\uB97C \uC774\uC2A4\uB77C\uC5D8\uACFC \uBE44\uAD50\uD558\uACE4 \uD558\uB358\uB370, \uC774\uC2A4\uB77C\uC5D8\uC758 \uD0C4\uB825\uC131 \uB118\uCE58\uB294 \uAD6D\uC801\uC815\uCC45\uC740 \uBE44\uAD50\uB97C \uC548\uD558\uB354\uB77C\uACE0. \uC774\uC2A4\uB77C\uC5D8\uC740 \uC778\uC7AC\uB97C \uAC00\uC838\uB2E4 \uC4F0\uACE0, \uC6B0\uB9AC\uB294 \uC778\uC7AC\uB97C \uBC84\uB9BC",
