  "text" : "'\uAE40\uC885\uD6C8 \uB0B4\uC815\uC790 \uC0AC\uD1F4' \uC0AC\uAC74(?)\uC744 \uBCF4\uBA74\uC11C \uB290\uB080\uAC74\uB370, \uC6B0\uB9AC\uB098\uB77C\uB294 \uC55E\uC73C\uB85C \uC678\uAD6D\uAD6D\uC801\uC758 \uC6B4\uB3D9\uC120\uC218\uB97C \uADC0\uD654\uC2DC\uCF1C \uAD6D\uAC00\uB300\uD45C\uC5D0 \uC120\uBC1C\uC2DC\uD0A4\uC9C0 \uB9D0\uC544\uC57C \uD560 \uAC83 \uAC19\uB2E4. \uADF8\uAC8C \uAD6D\uBBFC\uC5EC\uB860 \uC544\uB2CC\uAC00.. \uADF8 \uC678\uAD6D \uC6B4\uB3D9\uC120\uC218\uB3C4 \uC5B4\uB9B4 \uB54C\uC5D0\uB294 \uC9C0\uB124 \uB098\uB77C \uAD6D\uAC00\uB3C4 \uBD80\uB974\uACE0, \uB9F9\uC138\uB3C4 \uD558\uACE0 \uADF8\uB7AC\uACA0\uC9C0.",
