  "text" : "\uC0C8\uB85C \uC2DC\uD589\uB420 \uAC1C\uC815\uD615\uBC95\uC0C1 \uB0A8\uC131\uAC15\uAC04\uC8C4\uAC00 \uC5B4\uB5A4 \uC2DD\uC73C\uB85C \uC218\uC0AC\uAC00 \uC9C4\uD589\uC774 \uB418\uAC8C \uB420\uC9C0 \uAD81\uAE08\uD558\uAE34 \uD574\uC694. \uAE30\uC874\uC758 \uAC15\uAC04\uC8C4\uC640 \uAC70\uC758 \uBE44\uC2B7\uD55C \uBC29\uC2DD\uC73C\uB85C \uC99D\uAC70\uB97C \uC218\uC9D1\uD558\uC5EC \uC218\uC0AC\uB97C \uD560 \uAC83 \uAC19\uAE34 \uD569\uB2C8\uB2E4. \uADFC\uB370 \uC218\uC0AC \uACFC\uC815\uC5D0\uC11C \uB0A8\uC131 \uD53C\uD574\uC790\uB4E4\uC5D0\uAC8C\uB3C4 \uBAA8\uC695\uAC10\uC744 \uC8FC\uC2DC\uB824\uB098.. (\uB300\uCDA9 \uC608\uC0C1\uC740 \uB428)",
