  "text" : "'\uB0A8\uC790\uAC00 \uACFC\uC5F0 \uAC15\uC81C\uB85C \uC131\uAD50\uB97C \uB2F9\uD558\uB294 \uC77C\uC774 \uC788\uC744\uAE4C?' \uC2F6\uACA0\uC9C0\uB9CC, \uC774\uAC8C \uC788\uAE34 \uC788\uC2B5\uB2C8\uB2E4. \uC5C5\uBB34\uC0C1 \uC704\uB825\uC5D0 \uC758\uD55C \uAC04\uC74C \uB4F1\uB3C4 \uC788\uACE0 \uBB50.. \uB0A8\uC131\uC774 \uAC15\uC81C\uB85C \uB2F9\uD558\uB354\uB77C\uB3C4 \uC0C1\uB2F9\uC218\uC758 \uACBD\uC6B0 \uC2E0\uACE0\uB97C \uC548\uD558\uAC8C \uB418\uB2C8, \uC798 \uC54C\uB824\uC9C0\uC9C0 \uC54A\uAC8C \uB41C \uAC83\uC77C \uBFD0\uC774\uC8E0.",
