  "text" : "\uC62C\uD574 \uD558\uBC18\uAE30\uBD80\uD130 \uD615\uBC95\uC0C1 \uAC15\uAC04\uC8C4\uC758 \uAC1D\uCCB4\uC5D0 \uB0A8\uC790\uB3C4 \uD3EC\uD568\uC774 \uB418\uAC8C \uB418\uB294\uB370\uC694(\uAE30\uC874\uC5D0\uB294 \uBD80\uB140\uC790- \uC989, \uC5EC\uC131\uC73C\uB85C \uD55C\uC815), \uB0A8\uC790\uAC00 \uAC15\uC81C\uB85C \uC131\uAD50\uB97C \uB2F9\uD558\uB294 \uC77C\uC774 \uC885\uC885 \uC788\uC5C8\uC74C\uC5D0\uB3C4 \uBD88\uAD6C\uD558\uACE0 \uAC15\uAC04\uC774 \uC544\uB2CC \uAC15\uC81C\uCD94\uD589\uC8C4\uB85C\uBC16\uC5D0 \uCC98\uBC8C\uD560 \uC218 \uC5C6\uC5C8\uB358 \uAE30\uC874 \uBC95\uC758 \uD760\uACB0\uC744 \uCE58\uC720\uD558\uAE30 \uC704\uD568\uC785\uB2C8\uB2E4",
